import ItemListContainer from 'ItemListContainer';
import NavBar from 'components/Navbar';


const Layout = ({title}) => {
  return (
    <main>
      <h1>{title}</h1>
      </main>
  )
}

function App() {
  return (
  <main>
    <Layout title='Layout' />
    <NavBar />
    <ItemListContainer greeting='No hay articulos disponibles' />
    </main>
  );
}

export default App;
